import React from "react";
import { Link } from "react-router-dom";
import CustomNavlink from "../elements/CustomNavlink";
import "../styles/components/CustomNavbar.css";

export default function LandingNavbar() {
  return (
    <nav sticky="top" className="navbar">
      <Link to={"/"} className="navbrand">
        Lectio
      </Link>
      <CustomNavlink to="/login" text="Log In" className="navlink-component" />
      <CustomNavlink
        to="/signup"
        text="Sign Up"
        className="navlink-component"
      />
    </nav>
  );
}
